      if (!dateText) return "";

      const [month, ...rest] = dateText.split(/\s+/);
      const day = rest.join(" ").trim();
      const monthLabel = month || dateText;
      const dayLabel = day || "";

      return `
        <div class="absolute top-6 right-6 rounded-xl border-2 px-3 py-2 text-center leading-none" style="border-color: ${config.accent_color}; background: rgba(255,255,255,0.75);">
          <div class="text-xs font-semibold uppercase tracking-wide" style="color: ${config.text_color}; opacity: 0.75;">
            ${monthLabel}
          </div>
          ${dayLabel ? `<div class="text-lg font-bold mt-1" style="color: ${config.primary_color};">${dayLabel}</div>` : ``}
        </div>
      `;
    }

    function escapeHtml(value) {
      return String(value)
        .replace(/&/g, "&amp;")
        .replace(/</g, "&lt;")
        .replace(/>/g, "&gt;")
        .replace(/"/g, "&quot;")
        .replace(/'/g, "&#39;");
    }

    function renderParagraphs(paragraphs, color) {
      return (Array.isArray(paragraphs) ? paragraphs : [String(paragraphs || "")])
        .filter((p) => String(p).trim())
        .map(
          (p) => `
            <p class="text-lg leading-relaxed mb-3 last:mb-0" style="color: ${color};">
              ${escapeHtml(p).replace(/\n/g, "<br>")}
            </p>
          `
        )
        .join("");
    }

    function renderDescription(description, config) {
      if (!description) return "";

      if (typeof description === "object" && !Array.isArray(description)) {
        const sidraColor = config.primary_color || defaultConfig.primary_color;
        const areelColor = "#4f86c6";

        return `
          <div class="space-y-2">
            ${renderParagraphs(description.sidra || [], sidraColor)}
            ${renderParagraphs(description.areel || [], areelColor)}
          </div>
        `;
      }

      return renderParagraphs(description, config.text_color);
    }

    function renderWeekendImage(weekend) {
      const src = (weekend?.image || "").trim();
      if (!src) return `<div class="image-placeholder w-full h-64"></div>`;
      return `
        <div class="w-full h-64 bg-white flex items-center justify-center">
          <img
            class="w-full h-full object-contain"
            src="${escapeHtml(src)}"
            alt=""
            loading="lazy"
          />
        </div>
      `;
    }

    const toolsEnabled = new URLSearchParams(window.location.search).has("tools");

    function renderEmbedTools(config) {
      if (!toolsEnabled) return "";

      const options = weekends
        .map((w) => `<option value="${escapeHtml(String(w.id))}">${escapeHtml(`${w.id} â€” ${getWeekendTitle(w)}`)}</option>`)
        .join("");

      return `
        <div class="mt-10 rounded-2xl border p-6" style="border-color: ${config.accent_color}; background: rgba(255,255,255,0.75);">
          <div class="flex items-center justify-between gap-4 flex-wrap">
            <div>
              <div class="text-lg font-semibold" style="color: ${config.text_color};">Embed image helper</div>
              <div class="text-sm" style="color: ${config.text_color}; opacity: 0.8;">This panel only shows with <span class="font-mono">?tools=1</span></div>
            </div>
            <div class="text-sm" style="color: ${config.text_color}; opacity: 0.8;">
              Paste the generated <span class="font-mono">data:</span> URL into the JSON <span class="font-mono">"image"</span> field.
            </div>
          </div>

          <div class="mt-5 grid grid-cols-1 md:grid-cols-3 gap-4 items-start">
            <div>
              <label class="block text-sm font-semibold mb-2" style="color: ${config.text_color};">Weekend</label>
              <select id="embed-weekend" class="w-full rounded-xl px-3 py-2 border" style="border-color: ${config.accent_color}; background: white;">
                ${options}
              </select>
            </div>

            <div>
              <label class="block text-sm font-semibold mb-2" style="color: ${config.text_color};">Choose image</label>
              <input id="embed-file" type="file" accept="image/*" class="w-full" />
              <div class="text-xs mt-2" style="color: ${config.text_color}; opacity: 0.75;">Tip: JPEG/WebP will usually keep size smaller.</div>
            </div>

            <div>
              <label class="block text-sm font-semibold mb-2" style="color: ${config.text_color};">Preview</label>
              <div class="w-full h-32 rounded-xl overflow-hidden border" style="border-color: ${config.accent_color}; background: white;">
                <img id="embed-preview" class="w-full h-full object-contain hidden" alt="" />
                <div id="embed-preview-empty" class="w-full h-full flex items-center justify-center text-sm" style="color: ${config.text_color}; opacity: 0.6;">No image yet</div>
              </div>
            </div>
          </div>

          <div class="mt-5">
            <div class="flex gap-3 flex-wrap">
              <button id="embed-copy" class="rounded-xl px-4 py-2 font-semibold" style="background: ${config.primary_color}; color: white;">Copy data URL</button>
              <button id="embed-apply" class="rounded-xl px-4 py-2 font-semibold border" style="border-color: ${config.accent_color}; color: ${config.text_color}; background: white;">Apply to preview poster</button>
              <div id="embed-status" class="text-sm self-center" style="color: ${config.text_color}; opacity: 0.85;"></div>
            </div>
            <textarea id="embed-output" class="mt-3 w-full h-32 rounded-xl p-3 font-mono text-xs border" style="border-color: ${config.accent_color}; background: white;" placeholder="Choose an image to generate a data: URL..."></textarea>
          </div>
        </div>
      `;
    }

    function initEmbedTools() {
      if (!toolsEnabled) return;

      const fileInput = document.getElementById("embed-file");
      const output = document.getElementById("embed-output");
      const copyBtn = document.getElementById("embed-copy");
      const applyBtn = document.getElementById("embed-apply");
      const weekendSelect = document.getElementById("embed-weekend");
      const status = document.getElementById("embed-status");
      const preview = document.getElementById("embed-preview");
      const previewEmpty = document.getElementById("embed-preview-empty");

      if (!fileInput || !output || !copyBtn || !applyBtn || !weekendSelect || !status || !preview || !previewEmpty) return;

      let currentDataUrl = "";

      fileInput.addEventListener("change", () => {
        const file = fileInput.files?.[0];
        status.textContent = "";
        if (!file) return;

        const reader = new FileReader();
        reader.onload = () => {
          currentDataUrl = String(reader.result || "");
          output.value = currentDataUrl;
          preview.src = currentDataUrl;
          preview.classList.remove("hidden");
          previewEmpty.classList.add("hidden");
          status.textContent = `Generated (${Math.round(currentDataUrl.length / 1024)} KB text)`;
        };
        reader.onerror = () => {
          status.textContent = "Could not read file.";
        };
        reader.readAsDataURL(file);
      });

      copyBtn.addEventListener("click", async () => {
        status.textContent = "";
        const text = output.value.trim();
        if (!text) {
          status.textContent = "Nothing to copy yet.";
          return;
        }
        try {
          await navigator.clipboard.writeText(text);
          status.textContent = "Copied.";
        } catch {
          output.focus();
          output.select();
          status.textContent = "Select + copy manually (clipboard blocked).";
        }
      });

      applyBtn.addEventListener("click", () => {
        status.textContent = "";
        const text = output.value.trim();
        if (!text) {
          status.textContent = "Generate a data URL first.";
          return;
        }
        const id = Number(weekendSelect.value);
        const target = weekends.find((w) => Number(w.id) === id);
        if (!target) {
          status.textContent = "Weekend not found.";
          return;
        }
        target.image = text;
        createPoster(window.elementSdk?.config ? window.elementSdk.config : { ...defaultConfig });
      });
    }

    function createPoster(config) {
      const app = document.getElementById('app');
      
      app.innerHTML = `
        <div class="w-full min-h-full px-8 py-12">
          <div class="max-w-5xl mx-auto">
            <!-- Header -->
            <div class="text-center mb-12">
              <h1 id="main-title" class="text-6xl font-bold mb-3" style="color: ${config.primary_color};">
                ${config.poster_title}
              </h1>

            </div>

            <!-- Weekend Cards Grid -->
            <div class="grid grid-cols-1 md:grid-cols-2 gap-8">
              ${weekends.map(weekend => `
                <div class="rounded-3xl shadow-lg overflow-hidden ${weekend.id === 5 ? 'md:col-span-2' : ''}" style="background-color: ${config.card_color};">
                  <!-- Image Placeholder -->
                  ${renderWeekendImage(weekend)}
                  
                  <!-- Content -->
                  <div class="p-6 relative">
                    ${renderDateBadge(getWeekendDate(weekend), config)}
                    <div class="mb-4 pr-24">
                      <h2 class="text-3xl font-bold" style="color: ${config.text_color};">
                        ${getWeekendTitle(weekend)}
                      </h2>
                    </div>

                    <div class="mb-4 pb-4 border-b-2" style="border-color: ${config.accent_color};">
                      <p class="text-lg font-medium" style="color: ${config.text_color};">
                        ${weekend.gift}
                      </p>
                    </div>

                    <div class="mb-4">
                      ${renderDescription(weekend.description, config)}
                    </div>
                  </div>
                </div>
              `).join('')}
            </div>

            <!-- Footer -->
            <div class="text-center mt-12">
              <p class="text-xl font-medium" style="color: ${config.primary_color};">
                ðŸ’• I'm lovin ya <3 ðŸ’•
              </p>
            </div>
            ${renderEmbedTools(config)}
          </div>
        </div>
      `;

      initEmbedTools();
    }

    async function onConfigChange(config) {
      const mainTitle = document.getElementById('main-title');
      const subtitleText = document.getElementById('subtitle-text');
      
      if (mainTitle) {
        mainTitle.textContent = config.poster_title || defaultConfig.poster_title;
        mainTitle.style.color = config.primary_color || defaultConfig.primary_color;
      }
      
      if (subtitleText) {
        subtitleText.textContent = config.subtitle || defaultConfig.subtitle;
        subtitleText.style.color = config.text_color || defaultConfig.text_color;
      }
    }

    function mapToCapabilities(config) {
      return {
        recolorables: [
          {
            get: () => config.background_color || defaultConfig.background_color,
            set: (value) => {
              config.background_color = value;
              window.elementSdk.setConfig({ background_color: value });
            }
          },
          {
            get: () => config.card_color || defaultConfig.card_color,
            set: (value) => {
              config.card_color = value;
              window.elementSdk.setConfig({ card_color: value });
            }
          },
          {
            get: () => config.primary_color || defaultConfig.primary_color,
            set: (value) => {
              config.primary_color = value;
              window.elementSdk.setConfig({ primary_color: value });
            }
          },
          {
            get: () => config.text_color || defaultConfig.text_color,
            set: (value) => {
              config.text_color = value;
              window.elementSdk.setConfig({ text_color: value });
            }
          },
          {
            get: () => config.accent_color || defaultConfig.accent_color,
            set: (value) => {
              config.accent_color = value;
              window.elementSdk.setConfig({ accent_color: value });
            }
          }
        ],
        borderables: [],
        fontEditable: undefined,
        fontSizeable: undefined
      };
    }

    function mapToEditPanelValues(config) {
      return new Map([
        ["poster_title", config.poster_title || defaultConfig.poster_title],
        ["subtitle", config.subtitle || defaultConfig.subtitle]
      ]);
    }

    const sdk = window.elementSdk;
    const initialConfig = sdk?.config ? sdk.config : { ...defaultConfig };

    createPoster(initialConfig);

    if (sdk?.init) {
      sdk.init({
        defaultConfig,
        onConfigChange,
        mapToCapabilities,
        mapToEditPanelValues
      });
    }
  </script>
 </body>
</html>
